import { StyleSheet } from "react-native";

export default function Board() {


    const styles = StyleSheet.create({
        background: {
            backgroundColor: '#eaeaea',
            width: '500px',
            height: '500px'
        }


      });


    return (
        <div style={styles.background} >
            hi
        </div>
    )


}
